const lista = document.getElementById("listaDeProyectos");

const proyectos = [
  {
    link: "./coins/index.html",
    img: "./img/coins.png",
    name: "KonCoins"
  },
  {
    link: "https://suplementos-santo-domingo.herokuapp.com/",
    img: "./img/suplementos.png",
    name: "Suplementos santo domingo"
  },
  {
    link: "./Gravity/index.html",
    img: "./img/Gravity.png",
    name: "Gravity"
  },
  {
    link: "./game project/P/index.html",
    img: "./img/aventurero.png",
    name: "Aventurero"
  },
  {
    link: "http://comprayapp.com/",
    img: "./img/comprayapp.png",
    name: "comprayapp"
  },
  {
    link: "./2d/index.html",
    img: "./img/2D Collisions.png",
    name: "2D Particles simulation"
  },
  {
    link: "./3d/index.html",
    img: "./img/3D Collisions.png",
    name: "3D Particles simulation"
  },
  {
    link: "./snake/index.html",
    img: "./img/Snake.png",
    name: "Snake game"
  },
  {
    link: "./cubeGame/index.html",
    img: "./img/gameOfCubes.png",
    name: "Game of cubes"
  },
  {
    link: "./eco/index.html",
    img: "./img/Evolution.png",
    name: "Ecosistem simulation"
  },
  {
    link: "./Ecosistem simulator/index.html",
    img: "./img/Evolution2.png",
    name: "Ecosistem simulation2"
  },
  {
    link: "./tree/index.html",
    img: "./img/Tree.png",
    name: "Tree generator"
  },
  {
    link: "./Planet formation/index.html",
    img: "./img/Planet.png",
    name: "Planet formation"
  },
  {
    link: "https://luisherasme.github.io/LienzoEngine/",
    img: "./img/lienzoengine.png",
    name: "Lienzo Engine"
  },
  {
    link: "./Electricity/index.html",
    img: "./img/Electricity.png",
    name: "Electricity"
  },
  {
    link: "./Tanks/index.html",
    img: "./img/Tanks.png",
    name: "Tanks Game"
  },
  {
    link: "./Cellular Automata/index.html",
    img: "./img/Celular.png",
    name: "Cellular automata"
  },
  {
    link: "./spaceShip/index.html",
    img: "./img/Space.png",
    name: "Spaceship"
  },
  {
    link: "./Evol/index.html",
    img: "./img/Evol.png",
    name: "Evolution"
  }
];

for (let counter = 0; counter < proyectos.length; counter++) {
  let proyecto = proyectos[counter];
  const card = document.createElement("div");
  card.setAttribute("class", "col m4");
  card.innerHTML = `
    <a href="${proyecto.link}">
        <div class="conta">
        <span class="title">${proyecto.name}</span>
            <div class="card">
                <div class="card-image">
                    <img src="${proyecto.img}" alt="">
                </div>
            </div>
        </div>
    </a>
  `;

  lista.appendChild(card);
}

const images = document.getElementsByTagName("img");
console.log(images);
const canvas = document.getElementById("can");
canvas.width = window.innerWidth;
canvas.height = window.innerHeight;
const context = canvas.getContext("2d");

let Bodies = [];

const MOUSE = {
  x: 0,
  y: 0
};

document.body.addEventListener("mousemove", e => {
  MOUSE.x = e.clientX;
  MOUSE.y = e.clientY;
});

class Body {
  constructor(x, y) {
    this.x = x;
    this.y = y;
    this.color = "#fff";
    this.velocity = {
      x: 0,
      y: 0
    };
    this.acceleration = {
      x: 0,
      y: 0
    };
    this.size = 1;
  }

  update(data) {
    let color = getPixel(this.x / 40, this.y / 40, data);
    this.color = `rgb(${color.r}, ${color.g}, ${color.b})`;
    /*
    let x = MOUSE.x - this.x;
    let y = MOUSE.y - this.y;
    let mag = Math.hypot(x, y);
    x = x / mag;
    y = y / mag;
    this.velocity.x += x;
    this.velocity.y += y;
    if (this.velocity.x > 5) this.velocity.x = 5;
    if (this.velocity.y > 5) this.velocity.y = 5;
    this.x += this.velocity.x / 4;
    this.y += this.velocity.y / 4;
    */
    /*
    this.x -= x;
    this.y -= y;
    */
    circle(this.x, this.y, this.size, this.color);
    /*
    this.velocity.x += this.acceleration.x;
    this.velocity.y += this.acceleration.y;
    this.acceleration.x = 0;
    this.acceleration.y = 0;
    */
  }
}

function init() {
  for (let x = 0; x < 40; x++) {
    for (let y = 0; y < 40; y++) {
      Bodies.push(
        new Body(x * (window.innerWidth / 40), y * (window.innerHeight / 40))
      );
    }
  }
}

const hide_canvas = document.getElementById("hide_can");
hide_canvas.width = 400;
hide_canvas.height = 200;
const hide_canvas_context = hide_canvas.getContext("2d");
hide_canvas_context.drawImage(images[3], 0, 0);

function clear() {
  context.clearRect(0, 0, canvas.width, canvas.height);
}

function circle(x, y, s, c) {
  context.beginPath();
  context.fillStyle = c;
  context.arc(x, y, s, 0, Math.PI * 2);
  context.fill();
}

function getPixel(x, y, data) {
  var index = (Math.floor(y) * 400 + Math.floor(x)) * 4;
  var r = data[index];
  var g = data[index + 1];
  var b = data[index + 2];
  var a = data[index + 3];
  return { r, g, b, a };
}

function update() {
  clear();
  images[3].crossOrigin = "Anonymous";
  hide_canvas_context.drawImage(images[3], 0, 0, 400, 200);
  let imgData = hide_canvas_context.getImageData(0, 0, 400, 200);
  Bodies.forEach(body => {
    body.update(imgData);
  });
}

init();
setInterval(update, 1000 / 60);
